/*
 You are given a string, S, and a list of words, L, that are all of the same length. Find all starting indices of substring(s) in S that is a concatenation of each word in L exactly once and without any intervening characters.

For example, given:
S: "barfoothefoobarman"
L: ["foo", "bar"]

You should return the indices: [0,9].
(order does not matter). 
 */
#include <iostream>
#include <vector>
#include <stack>
#include <algorithm>
#include <limits>
#include <queue>
#include <map>
#include <unordered_map>

using namespace std;
class Solution {
    public:
        vector<int> findSubstring(string S, vector<string> &L) {
            int N = L.size();
            int len = L[0].length();

            int start = 0;
            vector<int> res;

            //if (S.length() >= 5000)
            //    return res;
            unordered_map<string, int> check;
            int n = 0;
            for (int k = 0; k < L.size(); k++){
                    check[L[k]] = 1;
            }
            for (int i = 0; i < L.size(); i++){
                n += L[i].length();
            }
            for (int i = 0; i < S.length() - n + 1 && i < len; i++){
                //cout <<"I: " << i<<endl;
                unordered_map<string, int> m;
                queue<int> idx;
                string sub;
                N = L.size();
                for (int k = 0; k < L.size(); k++){
                    if (m[L[k]] >= 1)
                        m[L[k]] = m[L[k]]+1;
                    else
                        m[L[k]] = 1;
                }
                N = L.size();
                for (int j = i; j < S.length() - len + 1; j+=len){
                    //cout << "O: " <<j << endl;
                    sub = S.substr(j, len);
                    if (check.find(sub) == check.end()) {
                        N = L.size();
                        for (int k = 0; k < L.size(); k++){
                            m[L[k]] = 0;
                        }
                        for (int k = 0; k < L.size(); k++){
                            if (m[L[k]] == 1)
                                m[L[k]] = m[L[k]]+1;
                            else
                                m[L[k]] = 1;
                        }
                        N = L.size();
                        continue;
                    } else {
                        if (m[sub] == 0){
                            // move to right
                            string ws;
                            do {
                                int w = idx.front();
                                ws = S.substr(w, len);
                                start += len;
                                m[ws] = m[ws]+1;
                                N++;
                                idx.pop();
                            } while (ws.compare(sub) != 0);
                        }
                        if (N==L.size())
                            start = j;
                        m[sub] = m[sub] - 1; 
                        idx.push(j);

                        N--;
                        //cout <<N <<endl;
                        if (N == 0) {
                            //cout <<start<<endl;;
                            res.push_back(start);
                            sub = S.substr(start, len);
                            m[sub]=m[sub]+1;
                            sub = S.substr(start +len, len);
                            start = start + len;
                            idx.pop();
                            //j = (idx[sub]>(i+len)?idx[sub]:(i+len));
                            N++;
                        }
                    }

                }
            }

            return res;
        }
};
